import { xmodemChecksum16bit } from './XMODEM';

const block1 = '';

const block2 = '';

describe('XMODEM', () => {
    it('should calculate CRC', () => {
        let block_data = Buffer.from(block1, 'hex');
        let chksum = xmodemChecksum16bit(block_data.subarray(2, block_data.length - 2));
        let crc = (block_data.at(block_data.length - 2)! << 8) + (block_data.at(block_data.length - 1)!);
        expect(chksum).toBe(crc);

        block_data = Buffer.from(block2, 'hex');
        chksum = xmodemChecksum16bit(block_data.subarray(2, block_data.length - 2));
        crc = (block_data.at(block_data.length - 2)! << 8) + (block_data.at(block_data.length - 1)!);
        expect(chksum).toBe(crc);
    });
});